) ENGINE=MyISAM AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci COMMENT='Player Position Dimension';

DROP TABLE IF EXISTS dim_season;
CREATE TABLE `dim_season` (
  `season` year NOT NULL,
