INSERT INTO fct_arrests(fct_arrests_id,dim_date_id,dim_team_id,dim_player_position_id,dim_crime_id,Name,Description,Encounter_raw,Crime_raw,Outcome_raw) VALUES('1','8342','39','5','1','\'Henry Ruggs\'','\'Accused of driving drunk, causing the death of a woman in a fiery collision in Las Vegas.\'','\'Arrested\'','\'DUI\'','\'Resolution undetermined. Team released him that day.\''),('2','8328','30','24','1','\'Damontae Kazee\'','\'Pulled over near Dallas, suspected of drunken driving after failed sobriety test.\'','\'Arrested\'','\'DUI\'','\'Resolution undetermined.\''),('3','8286','5','14','8','\'Bradley Chubb\'','\'Warrant issued after he failed to appear for a court date on misdemeanor traffic charges near Denver.\'','\'Arrested\'','\'Failure to appear\'','\'Resolution undetermined.\''),('4','8233','18','5','1','\'Deonte Harris\'','\'Pulled over in Baltimore County, suspected of driving drunk, reckless driving and speeding.\'','\'Arrested\'','\'DUI\'','\'Probation for one year.\''),('5','8231','38','15','27','\'Richard Sherman\'','\'Accused of crashing his car in a construction zone near Seattle, trying to break into home of wife\\\'s parents. Later signed with Tampa Bay.\'','\'Arrested\'','\'DUI, domestic violence\'','\'Resolution undetermined.\''),('6','8225','24','14','27','\'Barkevious Mingo\'','\'Charged with indecency with a child-sexual contact in Arlington, Texas.\'','\'Arrested\'','\'Indecency with child\'','\'Resolution undetermined. Team released him within two days.\''),('7','8221','6','14','4','\'Darius Hodge\'','\'Arrested in Wake Forest, N.C., on a warrant related to the alleged assault of a man in May 2019.\'','\'Arrested\'','\'Assault\'','\'Resolution undetermined.\''),('8','8216','17','3','2','\'Jarron Jones\'','\'Accused of assaulting girlfriend in Pittsburgh on Sept. 19, 2021, one of two incidents in a month.\'','\'Arrested\'','\'Domestic violence\'','\'Resolution undetermined. Team released him later that month.\''),('10','616','9','7','9','\'Stacey Mack\'','\'Accused of writing a worthless check for property less than $150, according to county records. Offense date was April 18, 2000.\'','\'Arrested\'','\'Theft\'','\'Pleaded no contest, $100 fine.\''),('11','621','7','24','9','\'Damien Robinson\'','\'Police pulled him over for a traffic violation and found warrant for his arrest on charge of writing a bad $80 check to the tax collector.\'','\'Arrested\'','\'Theft\'','\'Guilty, paid back funds.\''),('12','629','23','13','2','\'Dana Stubblefield\'','\'Accused of assaulting his wife at their homoe in Virginia during an argument about luggage. Police said there were no signs of physical injury.\'','\'Arrested\'','\'Domestic violence\'','\'Charge dropped.\''),('13','630','30','5','4','\'Joey Galloway\'','\'Accused of assaulting a police officer at a hotel party in Wheeling, W. Va., in May 2000.\'','\'Arrested\'','\'Assault\'','\'Charge dropped.\''),('14','667','5','11','1','\'Brian Griese\'','\'Pulled over for speeding near Denver, accused of drunk driving, failing sobriety tests.\'','\'Arrested\'','\'DUI\'','\'Pleaded guilty, one year of probation.\''),('15','682','32','7','16','\'Thomas Hamner\'','\'Investigated for animal cruelty involving his pit bull in New Jersey.\'','\'Arrested\'','\'Animal abuse\'','\'Pleaded guilty, $300 fine.\''),('16','690','4','4','1','\'John Davis\'','\'Police said they found his vehicle stopped in the road with him sleeping behind wheel, accused of drunk driving in Wayzata, Minn.\'','\'Arrested\'','\'DUI\'','\'Pleaded guilty to careless driving, fined $700, but $500 of it stayed along with 40-day jail sentence.\''),('17','988','37','5','1','\'Vinny Sutherland\'','\'Pulled over on Highway 101 in Bay Area , accused of drunk driving.\'','\'Arrested\'','\'DUI\'','\'Pleaded guilty to reduced charge of reckless driving, rehab, two years of probation.\''),('18','1018','31','24','6','\'Damien Robinson\'','\'Pulled over outside Giants stadium, where bomb-sniffing dog helped lead police to an assault rifle in his trunk. He had permit for the gun in New York.\'','\'Arrested\'','\'Gun\'','\'Charge dropped. Team fined him $30,000.\''),('19','1029','25','14','1','\'Ray Thompson\'','\'Accused of drunken driving after crash in Gilbert, Ariz.\'','\'Arrested\'','\'DUI\'','\'Resolution undetermined. Team fined and deactivated him after missing practice due to accident.\''),('20','1030','28','7','14','\'Travis Henry\'','\'Accused of attempting to have sex with a 15-year-old girl, who claimed she was almost 18.\'','\'Arrested\'','\'Sex\'','\'Pleaded guilty to misdemeanor sexual misconduct, 100 hours of community service.\''),('21','1046','9','5','1','\'Jimmy Smith\'','\'Pulled over for speeding in Jacksonville, accused of drunk driving. Tests later showed cocained in his system. Blood-alcohol measured below limit at .05.\'','\'Arrested\'','\'DUI\'','\'Charge dropped.\''),('22','1051','32','24','3','\'Terrence Carroll\'','\'Police caught him smoking marijuana in the back of a car, accused of misdemeanor drug possession.\'','\'Arrested\'','\'Drugs\'','\'Diversion program, one month of probation, 10 hours of community service, substance-abuse class.\''),('23','1054','14','15','3','\'Lamar Chapman\'','\'Pulled over as passenger in Mike Sellers\\\' car, accused of marijuana and cocaine possession.\'','\'Arrested\'','\'Drugs\'','\'Pleaded guilty to possession of drug paraphernalia.\''),('24','1054','14','6','1','\'Mike Sellers\'','\'Pulled over in Cleveland with teammate Lamar Champan, accused of speeding, drunk driving and marijuana and cocaine possesssion.\'','\'Arrested\'','\'DUI, drugs\'','\'Pleaded guilty to drunk driving. Team cut him a week after arrest.\''),('25','1055','14','13','6','\'Gerard Warren\'','\'Accused of carrying an unlicensed gun after police spotted a holster in his Suburban parked outside a nightclub party for Plaxico Burress.\'','\'Arrested\'','\'Gun\'','\'Pleaded guilty to misdemeanor gun charge, one year of probation.\''),('26','1055','32','24','16','\'Damon Moore\'','\'Accused of abandoning Rottweiler puppy in a New Jersey field three days after buying it. He found the dog to be too much trouble.\'','\'Arrested\'','\'Animal abuse\'','\'Pleaded guilty, 15 hours of community service and animal center, $2,000 fine.\''),('27','1072','14','4','3','\'O.J. Santiago\'','\'Police searched teammate Gerard Warren\\\'s car and found marijuana, which they said belonged to Santiago.\'','\'Arrested\'','\'Drugs\'','\'Guilty of disorderly conduct, $366 fine.\''),('28','1074','6','18','4','\'Neil Rackers\'','\'Accused of choking man at a sports bar in Covington, Ky., after the man allegedly insulted Rackers\\\' wife and mother.\'','\'Arrested\'','\'Assault\'','\'Diversion program. Charge dropped in exchange for confidential settlement with victim.\''),('29','1083','12','15','1','\'Eric Warfield\'','\'Pulled over after police saw him weaving in traffic, accused of drunk driving in Lenexa, Kan.\'','\'Arrested\'','\'DUI\'','\'Diversion program, later revoked when he was arrested again in 2003.\''),('30','1089','17','5','7','\'Plaxico Burress\'','\'Cited for carrying an open container of alcohol (beer) in the Cleveland warehouse district.\'','\'Arrested\'','\'Alcohol\'','\'Pleaded no contest, $50 fine, $100 court costs.\''),('31','1092','27','12','2','\'Bobby Hamilton\'','\'Accused of domestic assault in dispute with his wife, who showed no sign of injury, according to police.\'','\'Arrested\'','\'Domestic violence\'','\'Charge dropped.\''),('32','1093','18','5','9','\'Albert Connell\'','\'Accused of taking $3,500 from car of teammate Deuce McAllister and $863 from his locker. He claimed it was a prank.\'','\'Arrested\'','\'Theft\'','\'Charge dropped after he returend the money, and McAllister declined to press charges. Team released him Feb. 28\''),('33','1362','30','5','27','\'Deveren Johnson\'','\'Accused of pushing past security at airport, saying he was worried about missing early flight in Connecticut.\'','\'Arrested\'','\'Breach of peace\'','\'Resolution undetermined.\''),('34','1363','4','5','8','\'Randy Moss\'','\'Accused of careless driving after the officer stepped in front of his car to prevent illegal turn. Moss pushed cop with car, where marijuana was found.\'','\'Arrested\'','\'Reckless driving, drugs\'','\'Pleaded guilty to misdemeanor careless driving, 40 hours of community service, 30-day jail sentence stayed.\''),('35','1364','12','14','1','\'Lew Bush\'','\'Pulled over and ticketed for straddling a lane, accused of drunk driving, refusing sobriety test.\'','\'Arrested\'','\'DUI\'','\'Guilty, driver\\\'s license suspended.\''),('36','1371','22','18','1','\'Sebastian Janikowski\'','\'Pulled over in Oakland, accused of drunk driving. Blood-alcohol measured at .20.\'','\'Arrested\'','\'DUI\'','\'Pleaded no contest to misdemeanor DUI, three years of probation, $1,292 fine, DUI school.\''),('37','1376','14','14','9','\'Darren Hambrick\'','\'Accused of felony grand theft after he cashed a $5,682 check from the Carolina Panthers, then said he never received it and cashed the reissued check.\'','\'Arrested\'','\'Theft\'','\'Pleaded no contest, 20 hours of community service, one year of probation.\''),('38','1387','11','12','1','\'Bryan Robinson\'','\'Pulled over at 2:30 a.m., accused of driving with a suspended license, drunk driving and refusing a breath test, his second DUI arrest since June.\'','\'Arrested\'','\'DUI\'','\'Pleaded guilty, 360 hours of community service, alochol treatment, 18 months probation.\''),('39','1390','7','30','2','\'Cosey Coleman\'','\'Accused of misdemeanor battery after allegedly slapping and dragging his girlfriend outside day-care center.\'','\'Arrested\'','\'Domestic violence\'','\'Diversion program.\''),('40','1395','18','7','8','\'Deuce McAllister\'','\'Pulled over for allegedly driving 70 mph in a 40-mph zone on the way to team practice facility, accused of driving with a suspended license.\'','\'Arrested\'','\'License\'','\'Pleaded guilty on license charge, fined.\''),('41','1418','18','3','1','\'Victor Riley\'','\'Pulled over in New Orleans, accused of disobeying traffic signals and driving while intoxicated. Taken to jail at 2:25 a.m.\'','\'Arrested\'','\'DUI\'','\'Resolution undetermined.\''),('42','1420','26','3','8','\'Chris Terry\'','\'Accused of failing to appear in court as scheduled on domestic violence charge from July 2002.\'','\'Arrested\'','\'Failure to appear\'','\'Guilty. Team released him within hours.\''),('43','1422','26','5','4','\'Steve Smith\'','\'Accused of striking teammate Anthony Bright in a team film meeting. Bright ended up on the hospital and required facial surgery.\'','\'Arrested\'','\'Assault\'','\'Diversion program, anger counseling, one-game suspension by team.\''),('44','1428','26','7','1','\'Lamar Smith\'','\'Pulled over by a state trooper in Mecklenburg County, accused of driving while impaired, speeding and reckless driving.\'','\'Arrested\'','\'DUI\'','\'Resolution undetermined. Team placed him on paid leave the next day and released him in March 2003.\''),('45','1458','5','14','1','\'John Mobley\'','\'Accused of speeding and driving drunk south of Denver. He failed a sobriety test.\'','\'Arrested\'','\'DUI\'','\'Convicted, sentenced to seven days in jail, 100 hours of public service, two years probation.\''),('46','1714','28','5','1','\'Rodney Wright\'','\'Accused of refusing breath test, drunk driving, driving without a license and unsafe lane changes after three-car accident in which three were hurt.\'','\'Arrested\'','\'DUI\'','\'Resolution undetermined. Released by team within hours.\''),('47','1718','15','14','1','\'Matt Wilhelm\'','\'Police suspected him of drunk driving in San Diego. He acknowledged making a mistake.\'','\'Arrested\'','\'DUI\'','\'Found guilty, five years probation, $1,700 fine, 180-day suspended jail sentence.\''),('48','1720','26','24','1','\'Jarrod Cooper\'','\'Pulled over for speeding, accused of drunk driving, possession of a controlled substance (Xanax) without a prescription.\'','\'Arrested\'','\'DUI, drugs\'','\'Pleaded guilty to driving while impaired, one year deferred sentence, one year probation, four-game NFL suspension.\''),('49','1724','22','18','4','\'Sebastian Janikowski\'','\'Accused of misdemeanor assault, vandalism and public drunkenness after fight at supper club in Walnut Creek, Calif.\'','\'Arrested\'','\'Assault, alcohol\'','\'Charges dropped for lack of evidence.\''),('50','1735','31','12','1','\'John Abraham\'','\'Accused of refusing a sobriety test, drunk driving after crashing Hummer into fire hydrant in Baldwin, N.Y.\'','\'Arrested\'','\'DUI\'','\'Pleaded guilty to reduced charge of driving while impaired, fined $330, benched by team for one game.\''),('51','1741','11','7','1','\'Rabih Abdullah\'','\'Police said his SUV rolled over and gave him a concussion, accused him of drunk driving.\'','\'Arrested\'','\'DUI\'','\'Pleaded guilty to DUI, sentenced to one year of probation, #1,344 fines and costs.\''),('52','1745','24','15','9','\'Juran Bolden\'','\'Accused of driving stoken 2000 GMC Denali vehicle, possession of marijuana in Atlanta.\'','\'Arrested\'','\'Theft, drugs\'','\'Pleaded no contest to felony possession of stolen vehicle, misdemeanor stolen tags, three years probation, $3,000.\''),('53','1755','27','3','4','\'Kenyatta Jones\'','\'Accused of throwing a cup of hot water on his house guest.\'','\'Arrested\'','\'Assault\'','\'Pleaded no contest, one year of probation. Team released him five days later.\''),('54','1760','9','14','6','\'T.J. Slaughter\'','\'Accused of aggravated assault after two teens said he pointed a gun at them on a highway in verbal dispute. Police found the gun in his car.\'','\'Arrested\'','\'Assault, gun\'','\'Diversion program. Released by team a day later.\''),('55','1761','14','7','1','\'William Green\'','\'Pulled over, accused of drunk driving and having a bag of marijuana in his car. Blood-alcohol measured at .165.\'','\'Arrested\'